import React from "react";
import { styled } from "styled-components";

const Div = styled.div`
  background-color: #fff;
  padding: 15px 10px;

  & input {
    border: none;
  }

  & input:focus {
    outline: none;
  }
`;
export default function FormInput() {
  return (
    <Div>
      <input type="text" placeholder={<i class="fa fa-bed"></i>} />
      <input type="date" />
      <input type="text" />
    </Div>
  );
}
